import React from "react"
import logo from "../images/keys.png"

export default function Navbar() {
    return(
    <>
        <Navbar fixed="top"> 
            <Container>
                <Nav className="top-toolbar" fixed="top">
                <a class="navbar-brand" href="#">
                    <img src={logo} alt="logo" height="36"/>
                </a>
                    <Nav.Link href="#CreateNew">New Password</Nav.Link>
                    <Nav.Link href="#ViewAll">View Saved</Nav.Link>
                </Nav>
            </Container>
        </Navbar>

    </>
    );
};
